import React from "react";
import { Outlet, useNavigate } from "react-router-dom";

function Meat() {
  const navigate = useNavigate();

  const goToWagyu = () => {
    navigate("/meat/wagyu");
  };

  return (
    <>
      <h1>Meat!</h1>
      <Navbar />

      <nav>
        <button onClick={goToWagyu}>Go to Wagyu</button>
      </nav>
      <Outlet/>
    </>
  );
}

export default Meat;
